import React from 'react';
import { useState, useEffect } from 'react';
import '../../src/App.css';
export const Navbar = () => {
    
    const now = new Date().toLocaleTimeString().slice(0,7);
    const [state, setState] = useState(now);
    
    function changetime(){
        setInterval(changetime,1000);
        const newnow = new Date().toLocaleTimeString().slice(0,7);
        setState(newnow);
    }
    return (
        <div onPointerMove={changetime} className='Navbar'>
        <h2 >{state}</h2>
        <button className='button'></button>
        </div>
    );
}
export default Navbar;
